INSERT @Yamed_Spr_MedicalEmployee ([ID], [FAM], [IM], [OT], [Room], [LPU_ID], [USL_OK_ID], [PODR_ID], [OTD_ID], [PRVS_ID], [PROFIL_ID], [DET_ID], [VID_POM_ID], [SNILS], [IsInSchedule], [isReestrUpload]) VALUES (700259, N'Струкова', N'Оксана', N'Алексеевна', NULL, N'460032', 3, NULL, NULL, 22, 21, 1, 13, N'170-743-367 66', 1, 1)

												
												
												
select 
distinct CASE WHEN LPU_ID = 460032 THEN 'Филиал №1'
 			  WHEN LPU_ID = 460060 THEN 'Филиал №2'
 			  WHEN LPU_ID = 460031 THEN 'КГДП'
 ELSE 'Филиал не определен' END lpu_id,
t.usl_ok+'  '+t.tip+' ' +isnull(nam,''),											
count (distinct id) [кол-во зак случаев поданных на опату]												
,sum(case when idsp in (35,36,25) and pr_nov=0 then 0 else sumv end) [подано на сумму]												
												
from 												
(												
select distinct zs.id												
,zs.IDSP,zs.PR_NOV,												
sch.code_mo,sch.MONTH,sch.SchetType,  ---s.NHISTORY,												
s.sum_m SUMV,v.UMPNAME usl_ok,	s.P_CEL25,zs.OS_SLUCH_REGION ,db.NameWithID,em.LPU_ID,											
CASE 												
									WHEN s.P_CEL25='1.1' THEN 'НЕОТЛОЖКА АПП'			
									WHEN s.P_CEL25='1.3' THEN 'Д наблюдение'			
									WHEN  ( 			
									         ( (s.P_CEL25 LIKE '1%' AND s.P_CEL25 NOT LIKE '1.1' AND s.P_CEL25 NOT LIKE '1.3') OR s.P_CEL25 IN ('2.1','2.5','2.6'))			
										       AND    zs.OS_SLUCH_REGION IS NULL		
												 OR
											     zs.OS_SLUCH_REGION in (29,35,48,23,12,18) 	
												or s.P_CEL25 IN ('2.2')
											) THEN 'ПРОФИЛАКТИКА АПП'	
									WHEN 			
										(s.P_CEL25 = '3.0' and OS_SLUCH_REGION is null)		
										or 		
										zs.OS_SLUCH_REGION in (21,30,31,32,33,34,36,39,40) 		
										OR 		
										(s.P_CEL25='2.3' AND usl.CODE_USL like 'R03%')		
											then 'ЗАБОЛЕВАНИЯ АПП'	
											WHEN  	
										zs.OS_SLUCH_REGION in (6) 		
											then 'ЗАБОЛЕВАНИЯ АПП гемодиализ'	
										when usl.code_usl like 'R01%' then ms.name		
										ELSE 	''--zs.OS_SLUCH_REGION	+''+s.P_CEL25
										END tip	,db.Name nam	
FROM [D3_SCHET_OMS] sch												
		inner join D3_PACIENT_OMS p on p.d3_scid=sch.id										
		inner join D3_ZSL_OMS zs on zs.D3_PID=p.id										
		inner join d3_sl_oms s on s.D3_ZSLID=zs.id 										
				LEFT JOIN [D3_USL_OMS] usl on usl.D3_SLID=s.id								
		left join OsobSluchDb db on db.Id=zs.OS_SLUCH_REGION										
		left join medicalServices ms on ms.code_usl =usl.CODE_USL and s.DATE_2 between ms.dataBegin and isnull(ms.dataend,'20991231')										
		left join [D3_SANK_OMS] sank on sank.[D3_ZSLID]=zs.id and sank.s_tip=1										
		left join v006 v on v.IDUMP=zs.USL_OK										
		left join 	@Yamed_Spr_MedicalEmployee em on dbo.p_digit_only(em.SNILS)=dbo.p_digit_only(s.iddokt)									
		where sch.year=2023 										
		and sch.month=1										
		and sch.code_mo='460031'										
		--and zs.usl_OK=3										
		)t										
		group by LPU_ID,										
		t.usl_ok+'  '+t.tip+' ' +isnull(nam,'')										
